@font-face {
  font-family: 'Roboto';
  font-style: regular;
  font-weight: normal;
  src: local('Roboto'), local('Roboto-Regular'), url(data:application/x-font-woff;base64,) format('woff');
}
@font-face {
  font-family: 'Roboto';
  font-style: italic;
  font-weight: normal;
  src: local('Roboto'), local('Roboto-Italic'), url(data:application/x-font-woff;base64,) format('woff');
}
@font-face {
  font-family: 'Roboto';
  font-style: normal;
  font-weight: 700;
  src: local('Roboto'), local('Roboto-700'), url(data:application/x-font-woff;base64,) format('woff');
}
@font-face {
  font-family: 'Roboto';
  font-style: italic;
  font-weight: 700;
  src: local('Roboto'), local('Roboto-700italic'), url(data:application/x-font-woff;base64,) format('woff');
}
